        <div>
            <div className="popup-header">
                <div>

                </div>
            </div>
        </div>
    )
}

const PopupBody = () => {
    return(
        <div>
            <div className="popup-body">
                <div>

                </div>
            </div>
        </div>
    )
}

const Popup = () => {
    return(
        <div>
            <PopupHeader />
